import React, { Component } from 'react';
import Navbar from '../components/Nav';
import background from "../assets/otherpages.png";
import text from "../assets/ourServices.png"
import "../App.css"

class Servicespage extends Component {
  constructor(props) {
    super(props);
    this.state = {

    };
  }

  render() {
    return (
      <div>
        <div style={{width:'100vw'}}>
        <img src={background} alt="" style={{position:'absolute', zIndex:'-1', width:'100%', height:'50%', overflow:'hidden'}} className="topbackgroundImage"/>
        </div>
        <Navbar/>
        <div style={{width:'100vw'}} className="d-flex justify-content-center">
          <div style={{width:'60%', height:'60vh'}} className="d-flex justify-content-center align-items">
          <img src={text} alt="" style={{width:'100%'}}/>
          </div>
        </div>
      </div>
    );
  }
}

export default Servicespage;
